(function(window) {
    var WABTN = function() {
        this.show = ((navigator.userAgent.match(/Android|iPhone/i) && !navigator.userAgent.match(/iPod|iPad/i)) ? true : false);
    }

    WABTN.prototype.share = function(data) {
        if (data === null || typeof data !== "object") {
            return;
        }
        if (!(data.id && data.text)) {
            return;
        }

        var btnChild = document.createElement("img");
        btnChild.src = this.btnImage;
        btnChild.style.width = (data.img_size ? (data.img_size == "sm" ? "25%" : (data.img_size == "lg" ? "100%" : "50%")) : "50%");

        var btn = document.createElement("a");
        btn.href = "whatsapp://send?text=" + encodeURIComponent(data.text);
        btn.className += " wasend";
        btn.appendChild(btnChild)

        var element = document.getElementById(data.id);
        element.style.width = "250px";
        element.appendChild(btn)
        if (!this.show) {
            element.style.display = "none";
        }
    }

    // base64 encoded image
    WABTN.prototype.btnImage = "data:image/png;base64,";

    window.WABTN = new WABTN();
})(window);
